    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments from August through October
    of 1941. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, and violations. Photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
